function pageprocessorMap(pagedef, $scope, $routeParams, $compile, $http, $rootScope, $sce, $window, $location) {
    $("#appContent").append($(pagedef.pageTemplate));
    try {
        var cb = function () {
            $("#MapMapCanvas").gmap({
                "center": pagedef.mapcenter,
                "zoom": parseInt(pagedef.mapzoom),
                "disableDefaultUI": false,
                "callback": function () {
                    var self = this;
                    var i = 0;
                    if (pagedef.mapmarkers) {
                        var markers = $.parseJSON(pagedef.mapmarkers);
                        console.log(markers);
                        i = 0;
                        $.each(markers, function (key, val) {
                            setTimeout(function () {
                                self.addMarker({
                                    "position": val.lat + "," + val.long,
                                    "animation": google.maps.Animation.DROP
                                }).click(function () {
                                    self.openInfoWindow({
                                        "content": val.desc
                                    }, this);
                                });
                            }, i * 200);
                            i++;
                        });
                    }
                }
            });
        };
        window.cb = cb;
        $.getScript("https://maps.googleapis.com/maps/api/js?key=AIzaSyDUbP_Qxh9wbPOvgW8iH_zuLu8K3fSlv0I&sensor=false&callback=cb");
    } catch (e) {
        alert(e);
    }
}

